-- fichier qui va servir à intialiser la BDD du projet
-- commande : psql -U trombino -f sql/init.sql

-- structure des tables

-- on supprime les tables si elles existent
DROP TABLE IF EXISTS "student";
DROP TABLE IF EXISTS "teacher_promo"; -- Attention de supprimer cette table de liaison avant les tables auxquelles elles se réfèrent.
DROP TABLE IF EXISTS "promo";
DROP TABLE IF EXISTS "teacher";

-- on crée les tables nécessaires

CREATE TABLE IF NOT EXISTS "promo" (
  "id" SERIAL PRIMARY KEY,
  "name" VARCHAR(128),
  "github_organization" VARCHAR(255)
);

CREATE TABLE IF NOT EXISTS "student" (
  "id" SERIAL PRIMARY KEY,
  "first_name" VARCHAR(128),
  "last_name" VARCHAR(128),
  "github_username" VARCHAR(255),
  "profile_picture_url" VARCHAR(255),
  "promo_id" INT REFERENCES "promo"("id")
);

CREATE TABLE IF NOT EXISTS "teacher" (
  "id" SERIAL PRIMARY KEY,
  "first_name" VARCHAR(100) NOT NULL,
  "last_name" VARCHAR(100) NOT NULL,
  "github_username" VARCHAR(100),
  "profile_picture_url" VARCHAR(255)
);

CREATE TABLE IF NOT EXISTS "teacher_promo" (
  "teacher_id" INT REFERENCES "teacher"("id"),
  "promo_id" INT REFERENCES "promo"("id"),
  PRIMARY KEY ("teacher_id", "promo_id")
);

-- data




